import React from 'react';
// import { Counter } from './features/counter/Counter';
import './App.css';
import TodoInput from './featurs/todo/TodoInput';
import TodoList from './featurs/todo/TodoList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Todo List
      </header>
      <TodoInput />
      <TodoList />
    </div>
  );
}

export default App;
